import React from "react";
import "./style.css";
import underprocess from "../Media/under-process.png";

const interior = () => {
  return (
    <>
      <main className="col-sm-12 col-md-12 col-lg-12 col-xl-12 main p-5">
        <img
          src={underprocess}
          className="img-fluid under-process"
          alt=""
        />
      </main>
    </>
  );
};

export default interior;
